@Component({
  selector: 'app-modal-permissao',
  templateUrl: './modal-permissao.page.html',
  styleUrls: ['./modal-permissao.page.scss'],
})
export class ModalPermissaoPage implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}

<ion-content [fullscreen]="true">
  <div id="header">
    <div id="app-bar">
      <ion-icon name="arrow-back-outline"></ion-icon>
      <div id="logo">
        <img src="assets/icon/moio.png" alt="" />
      </div>
      <div></div>
    </div>
  </div>


  <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Omnis saepe voluptatibus voluptate deserunt officia nemo maxime voluptatem veritatis, ut deleniti? Voluptatem omnis laboriosam officiis! Aspernatur numquam voluptate minus maxime quibusdam.</p>
  <ion-button>Close</ion-button>
</ion-content>
